import { StyleSheet } from "react-native";

import { gameCardThumbnailBorderColor } from "../../styles";

const styles = StyleSheet.create({
  thumbnail: {
    width: 38,
    height: 38,
    borderWidth: 0.5,
    borderStyle: "solid",
    borderColor: gameCardThumbnailBorderColor,
    borderRadius: 1,
  },
});

export default styles;
